import { Route, BrowserRouter as Router, Routes } from 'react-router-dom';
import { PrivateRoutes } from './auth/PrivateRoutes';
import { EmailVerfication } from './pages/EmailVerfication';
import { ForgetPasswordPage } from './pages/ForgetPasswordPage';
import { LoginPage } from './pages/LoginPage';
import { SignupPage } from './pages/SignupPage';
import { UserInfoPage } from './pages/UserInfoPage';
import { VerficationPage } from './pages/VerficationPage';
export const AppRoutes = () => {
  return (
    <Router>
      <Routes>
        <Route
          path="/"
          element={
            <PrivateRoutes>
              <UserInfoPage />
            </PrivateRoutes>
          }
        />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/signup" element={<SignupPage />} />
        <Route path="/please-verify-email" element={<VerficationPage />} />
        <Route
          path="/verify-email/:verificationCode"
          element={<EmailVerfication />}
        />
        <Route path="/forgot-password" element={<ForgetPasswordPage />} />
      </Routes>
    </Router>
  );
};
